import React from 'react';

class Router extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            notFound: true
        }
        this.verifyIfFound = this.verifyIfFound.bind(this);
    }
    verifyIfFound() {
        this.setState({ notFound: true });
    }
    componentDidMount() {
        let i = 0;
        while (i < this.props.children.length && this.state.notFound) {
            this.props.children[i].props.found = this.verifyIfFound;
            i++;
        }
    }
    render() {
        return(
            <div>
                { this.props.children }
            </div>
        )
    }
}

export default Router;
